    {id:'e3', title: "Car Insurance", amount: 294.67, date: new Date(2021, 2, 28)},
    {id:'e4', title: "Car Insurance", amount: 294.67, date: new Date(2021, 2, 28)}
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
